Соционика обо мне (что-то в этом есть:)):

Моё мышление носит эмоционально-чувственный характер. В жизни стараюсь избегать опасностей и плохого к себе отношения. Этим объясняется нежелание входить в близкий контакт с людьми и приверженность строгим морально-этическим нормам, что позволяет мне сохранять стабильное эмоциональное состояние. Нарушение кем-либо этих норм вызывает жёсткую критику с моей стороны.
Посягательство на мои убеждения, жизненную позицию, материальные или стратегические интересы вызывает активное сопротивление. Здесь я проявляю волевые качества, становлюсь собранным и решительным, способен подолгу в одиночку отстаивать свою позицию. Этому также способствует умение просчитывать свои действия на несколько шагов вперед. Однако глубинная критика приводит к болезненным переживаниям, особенно если я считаю ее справедливой. В первые моменты могу среагировать неоправданно резко, о чем впоследствии жалею.
Считаю себя человеком объективным, беспристрастным. Это находит отражение в манере общения с окружающими, в частности, в поддержании далекой психологической дистанции. Однако объективность и беспристрастность не столь сильны, как я об этом думаю. Поскольку я отношусь к чувствующему типу, личное отношение к людям сильно влияет на меня. Так, открыто избегаю тех, кто неприятен мне, хотя в вынужденных беседах придерживаюсь вежливой и корректной формы общения, не иду на конфронтацию. С собеседником, к которому чувствую расположение, могу легко вступить в доверительный разговор. Вообще, испытываю потребность в человеке, на которого можно всегда положиться.
Проявление отрицательных эмоций как со своей стороны, так и со стороны окружающих рассматриваю как недостаток. Стараюсь успокоить тех, кто проявляет такие эмоции, даю мягкие, ненавязчивые советы по этому поводу. Нетерпим к проявлениям несправедливости. Люблю положительную эмоциональную атмосферу и физический комфорт (кто ж его не любит?), стараюсь избегать дисгармонии с окружающим миром. Беспорядок вызывает неприятные ощущения, но регулярно тратить энергию на его устранение я не хочу. Делаю это эпизодически, при этом не затрачивая больших усилий.
Ориентация на эмоции позволяет мне хорошо чувствовать людские взаимоотношения. Умею ориентироваться в иерархических структурах, легко определяю неформального лидера. Если этот человек соответствует моим морально-этическим установкам, стараюсь войти с ним в близкий контакт и заручиться поддержкой. В противном случае пытаюсь подчинить его себе. Если это не удается, стремлюсь вовсе избавиться от этого человека. Роль руководителя хорошо мне удается. Я требователен к себе и другим, очень работоспособен. При этом стараюсь побудить коллектив к работе путем апелляции к этическим ценностям. Умею делегировать полномочия, обычно не беру всю ответственность на себя. Предпочитаю работу, дающую непосредственную материальную отдачу. В противном случае могу потерять выдержку и терпение.
Люблю анализировать различные события и явления окружающего мира и свое взаимодействие с этим миром. Однако резкие перемены приводят к кризису мировоззрения. Зачастую я не могу даже осознать, что эти перемены действительно произошли. В такой ситуации нуждаюсь в совете со стороны. В стабильной обстановке ищу и нахожу ситуации, из которых можно извлечь пользу. Часто использую результаты таких изысканий в служебной деятельности. Большое место отвожу самоанализу. К сожалению, я зачастую недооцениваю свои способности, в лучшем случае воспринимаю их критически. Это приводит к неуверенности в себе. Информация, обосновывающая и подтверждающая правильность предпринимаемых действий, меня активизирует.

Сильные стороны:
• строгая приверженность выбранным морально-этическим ценностям;
• умение находить индивидуальный подход к людям;
• высокая работоспособность;
• умение отстаивать свои интересы.

Слабые стороны:
• неуверенность в себе;
• неумение быстро адаптироваться к переменам;
• трудности с пониманием скрытых причин
